import React from 'react';
import { FaHome, FaClipboardList, FaUserCheck } from 'react-icons/fa';

const SidePanel = () => {
  const panelStyle = {
    height: '100vh',
    width: '240px',
    backgroundColor: '#2d216b',
    color: 'white',
    padding: '20px',
    display: 'flex',
    flexDirection: 'column',
    boxShadow: '2px 0 10px rgba(0, 0, 0, 0.2)',
  };

  const headerStyle = {
    display: 'flex',
    alignItems: 'center',
    gap: '10px',
    marginBottom: '40px',
    fontSize: '24px',
    fontWeight: '600',
  };

  const navStyle = {
    display: 'flex',
    flexDirection: 'column',
    gap: '20px',
  };

  const navItemStyle = {
    display: 'flex',
    alignItems: 'center',
    gap: '10px',
    cursor: 'pointer',
    color: 'white',
    fontSize: '16px',
  };

  const iconStyle = {
    color: 'black',
  };

  return (
    <div style={panelStyle}>
      <div style={headerStyle}>
        <span>Speedster</span>
        <span role="img" aria-label="speed-icon">üèéÔ∏è</span>
      </div>

      <nav style={navStyle}>
        <div style={navItemStyle}>
          <FaHome style={iconStyle} />
          <span>Home</span>
        </div>

        <div style={navItemStyle}>
          <FaClipboardList style={iconStyle} />
          <span>Registration</span>
        </div>

        <div style={navItemStyle}>
          <FaUserCheck style={iconStyle} />
          <span>Authentication</span> {/* –ò—Å–ø—Ä–∞–≤–ª–µ–Ω–∞ –æ—à–∏–±–∫–∞ –≤ —Å–ª–æ–≤–µ */}
        </div>
      </nav>
    </div>
  );
};

export default SidePanel;
